// SignIn.js
import React from 'react';

const SignIn = () => {
  return (
    <center><div style={{ flex: '1', paddingLeft: '20px', fontSize: '18px' }}>
    <center>
      <div>
        <h2 style={{ fontSize: '24px' }}>Log In Page</h2>
        <p>Log in to access your account.</p>

        <div style={{ marginBottom: '10px' }}>
          <input type="text" id="username" name="uname" placeholder='Enter your Username' style={{ marginBottom: '10px' }}></input><br></br>
          <input type="text" id="password" name="pswd" placeholder='Enter your Password' style={{ marginBottom: '10px' }}></input><br></br>
        </div>

        <div>
          <a href="/about"><button type="submit">Login</button></a>
        </div>
        <div>
          <a href="/signin">Don't have an account? Signup!</a>
        </div>
      </div>
    </center>
  </div></center>


  );
};

export default SignIn;
